response:
\boxed{\frac{1}{3}} 

Рассмотрим четыре случайно выбранные точки A, B, C и D на окружности. Для того чтобы хорды AB и CD пересекались, необходимо и достаточно, чтобы их концы чередовались при обходе окружности, то есть в порядке, например, A, C, B, D (или другом эквивалентном порядке). 

При фиксации 4 точек на окружности существует ровно 3 способа разбить их на две пары (то есть провести две хорды). Из этих трёх разбиений только одно приведёт к тому, что хорды будут пересекаться (пары будут составлены так, что их концы чередуются). Поэтому вероятность того, что заданные хорды AB и CD пересекаются, равна 1/3.
